les joueurs de foot 5 de trouver 10 personnes disponibles sur un même créneau horaire et d’organiser un match.\n-          Le pouvoir donné aux joueurs qui réservent gratuitement.\n\nFive Goal est une application qui vient répondre à ces problématiques en permettant aux joueurs de trouver des personnes disponibles et d’organiser leurs matchs de manière simple et ludique à travers les 280 complexes référencés dans l’application. Notre Business Model prévoit d’autres innovations dont nous pourrons parler ensemble si vous êtes intéressés.\n\nLe foot à 5 est en effet un marché international récent avec des croissances fulgurantes comme en Asie ou aux Etats-Unis. C’est pour cela que Five Goal veut devenir l’acteur digital majeur de ce sport en France avant de s’internationaliser.\n\nCette innovation, anciennement appelée « Ça Match » a été récompensé plusieurs fois sur le territoire régional et a déjà convaincu la presse (France 3, NRJ, La Provence, Le 20 Minutes, LCM, …) ainsi que des acteurs majeurs tels que la ville de Marseille, ou encore l’Union européenne. Vous serez en charge notre de la partie front end de l’application au quotidien. L’application hybride est développée en utilisant le framework Ionic. Elle fait appel à notre API REST, développée en Nodejs. Les objectifs de cette mission sont de développer certaines fonctionnalités front end et en faisant appel à notre API. Mais aussi de gérer la maintenance de l’application.','43.296051','5.478951','[\'Ionic (framework v1)\', \'Javascript\', \'API Rest\']','https://process.filestackapi.com/resize=width:600/auto_image/compress/cq8IIXiVQ1CMcgI9VQdl'),(1843,'kygrPCOYdOZ72Wch5jzsVPq4lno1','wixiweb','2.0','Wixiweb','True','8','https://www.wixiweb.fr','Nan','Wixiweb conçoit et réalise des plate-formes web : site Internet, application web, extranet, mobile. Forts de notre expertise PHP, nous accompagnons les porteurs de projets sur des solutions développées en sur-mesure','49.463741999999996','1.097192','[\'PHP\', \'Ja